- model: problem.problem
  pk: 1
  fields:
    title: A+B problem
    description: "# 题目背景\r\n\r\n**不熟悉算法竞赛的选手请看这里：**\r\n\r\n算法竞赛中要求的输出格式中，不能有多余的内容，这也包括了“请输入整数`a`和`b`”这一类的提示用户输入信息的内容。若包含了这些内容，将会被认为是\
      \ `Wrong Answer`，即`SOJ`上的 `WA`。忽略每一行结尾的空格，以及最后一行之后，多余的换行符。\r\n\r\n若因此类问题出现本机（看起来）\
      \ `AC`，提交 `WA` 的现象，请勿认为是`SOJ`评测机出了问题，而是你的代码中可能存在多余的输出信息。用户可以参考在题目末尾提供的代码。\r\n\
      \r\n\r\n# 题目描述\r\n\r\n输入两个整数 $a,b$ 输出它们的和（$|a|,|b|\\leq 10^9$）。\r\n\r\n注意\r\n\
      ```\r\nPascal 使用 integer 会爆掉哦！\r\n有负数哦！\r\nC/C++ 的 main 函数必须是 int 类型，而且最后要 return\
      \ 0。这不仅对洛谷其他题目有效，而且也是 NOIP/NOI/CSP 比赛的要求！\r\n```\r\n好吧，同志们，我们就从这一题开始，向着大牛的路进发。\r\
      \n\r\n> 任何一个伟大的思想，都有一个微不足道的开始。\r\n\r\n# 输入格式\r\n\r\n两个整数以空格分开。\r\n\r\n# 输出格式\r\
      \n\r\n一个整数。\r\n\r\n# 输入输出样例\r\n\r\n# 输入 #1\r\n\r\n```\r\n20 30\r\n```\r\n\r\n\
      # 输出 #1\r\n\r\n```\r\n50\r\n```\r\n\r\n# 说明/提示\r\n\r\n**本题各种语言的程序范例：**\r\n\r\
      \nC\r\n\r\n```c\r\n#include <stdio.h>\r\n\r\nint main() {\r\n    int a,b;\r\n\
      \    scanf(\"%d%d\",&a,&b);\r\n    printf(\"%d\", a+b);\r\n    return 0;\r\n\
      }\r\n```\r\n\r\nC++\r\n\r\n```cpp\r\n#include <iostream>\r\n#include <cstdio>\r\
      \n\r\nusing namespace std;\r\n\r\nint main() {\r\n    int a,b;\r\n    cin >>\
      \ a >> b;\r\n    cout << a+b;\r\n    return 0;\r\n}\r\n```\r\n\r\nPascal\r\n\
      \r\n```pas\r\nvar a, b: longint;\r\nbegin\r\n    readln(a,b);\r\n    writeln(a+b);\r\
      \nend.\r\n\r\nPython2\r\n\r\ns = raw_input().split()\r\nprint int(s[0]) + int(s[1])\r\
      \n\r\nPython3\r\n\r\ns = input().split()\r\nprint(int(s[0]) + int(s[1]))\r\n\
      ```\r\n\r\nJava\r\n\r\n```java\r\nimport java.io.*;\r\nimport java.util.*;\r\
      \npublic class Main {\r\n    public static void main(String args[]) throws Exception\
      \ {\r\n        Scanner cin=new Scanner(System.in);\r\n        int a = cin.nextInt(),\
      \ b = cin.nextInt();\r\n        System.out.println(a+b);\r\n    }\r\n}\r\n```\r\
      \n\r\n\r\nRust\r\n\r\n```rust\r\nuse std::io;\r\n\r\nfn main(){\r\n    let mut\
      \ input=String::new();\r\n    io::stdin().read_line(&mut input).unwrap();\r\n\
      \    let mut s=input.trim().split(' ');\r\n\r\n    let a:i32=s.next().unwrap()\r\
      \n               .parse().unwrap();\r\n    let b:i32=s.next().unwrap()\r\n \
      \              .parse().unwrap();\r\n    println!(\"{}\",a+b);\r\n}\r\n```"
    pid: 1
    date_added: 2020-07-23 08:58:43.680570+00:00
    allow_html: false
    enabled: true
    tags:
    - 1
