    title: Markdown Tests
    description: "# 标题H1\r\n\r\n## 标题H2\r\n\r\n### 标题H3\r\n\r\n#### 标题H4\r\n\r\n#####\
      \ 标题H5\r\n\r\n###### 标题H5\r\n\r\n### 字符效果和横线等\r\n----\r\n\r\n~~删除线~~ \r\n\r\n\
      <s>删除线（开启识别HTML标签时）</s>\r\n\r\n*斜体字*      _斜体字_\r\n\r\n**粗体**  __粗体__\r\n\r\n\
      ***粗斜体*** ___粗斜体___\r\n\r\n上标：X<sub>2</sub>，下标：O<sup>2</sup>\r\n\r\n**缩写(同HTML的abbr标签)**\r\
      \n> 即更长的单词或短语的缩写形式，前提是开启识别HTML标签时，已默认开启\r\n\r\nThe <abbr title=\"Hyper Text\
      \ Markup Language\">HTML</abbr> specification is maintained by the <abbr title=\"\
      World Wide Web Consortium\">W3C</abbr>.\r\n### 引用 Blockquotes\r\n\r\n> 引用文本\
      \ Blockquotes\r\n\r\n引用的行内混合 Blockquotes\r\n\r\n> 引用：如果想要插入空白换行`即<br />标签`，在插入处先键入两个以上的空格然后回车即可，[普通链接](https://www.mdeditor.com/)。\r\
      \n\r\n\r\n### 多语言代码高亮 Codes\r\n\r\n#### 行内代码 Inline code\r\n\r\n\r\n执行命令：`npm\
      \ install marked`\r\n\r\n#### 缩进风格\r\n\r\n即缩进四个空格，也做为实现类似 `<pre>` 预格式化文本 ( Preformatted\
      \ Text ) 的功能。\r\n\r\n    <?php\r\n        echo \"Hello world!\";\r\n    ?>\r\
      \n预格式化文本：\r\n\r\n    | First Header  | Second Header |\r\n    | -------------\
      \ | ------------- |\r\n    | Content Cell  | Content Cell  |\r\n    | Content\
      \ Cell  | Content Cell  |\r\n\r\n#### JS代码\r\n```javascript\r\nfunction test()\
      \ {\r\n\tconsole.log(\"Hello world!\");\r\n}\r\n```\r\n\r\n#### HTML 代码 HTML\
      \ codes\r\n```html\r\n<!DOCTYPE html>\r\n<html>\r\n    <head>\r\n        <mate\
      \ charest=\"utf-8\" />\r\n        <meta name=\"keywords\" content=\"Editor.md,\
      \ Markdown, Editor\" />\r\n        <title>Hello world!</title>\r\n        <style\
      \ type=\"text/css\">\r\n            body{font-size:14px;color:#444;font-family:\
      \ \"Microsoft Yahei\", Tahoma, \"Hiragino Sans GB\", Arial;background:#fff;}\r\
      \n            ul{list-style: none;}\r\n            img{border:none;vertical-align:\
      \ middle;}\r\n        </style>\r\n    </head>\r\n    <body>\r\n        <h1 class=\"\
      text-xxl\">Hello world!</h1>\r\n        <p class=\"text-green\">Plain text</p>\r\
      \n    </body>\r\n</html>\r\n```\r\n### 图片 Images\r\n\r\n图片加链接 (Image + Link)：\r\
      \n\r\n\r\n![xxx](https://cdn.luogu.com.cn/upload/usericon/108422.png\")\r\n\r\
      \n> Follow your heart.\r\n\r\n----\r\n### 列表 Lists\r\n\r\n#### 无序列表（减号）Unordered\
      \ Lists (-)\r\n\r\n- 列表一\r\n- 列表二\r\n- 列表三\r\n\r\n#### 无序列表（星号）Unordered Lists\
      \ (*)\r\n\r\n* 列表一\r\n* 列表二\r\n* 列表三\r\n\r\n#### 无序列表（加号和嵌套）Unordered Lists\
      \ (+)\r\n+ 列表一\r\n+ 列表二\r\n    + 列表二-1\r\n    + 列表二-2\r\n    + 列表二-3\r\n+ 列表三\r\
      \n    * 列表一\r\n    * 列表二\r\n    * 列表三\r\n\r\n#### 有序列表 Ordered Lists (-)\r\n\
      \r\n1. 第一行\r\n2. 第二行\r\n3. 第三行\r\n\r\n#### GFM task list\r\n\r\n- [x] GFM task\
      \ list 1\r\n- [x] GFM task list 2\r\n- [ ] GFM task list 3\r\n    - [ ] GFM\
      \ task list 3-1\r\n    - [ ] GFM task list 3-2\r\n    - [ ] GFM task list 3-3\r\
